import React from 'react'

const PricingBox = ({pricebox: {name, price, icon, content, recommemded}}) => {
  return (
    <div className={recommemded ? 'price-box text-center recommended': 'price-box text-center'}>
      <span className={`price-icon mdi ${icon}`}></span>
      <span className='plan'>{name}</span>
      <h3 className='price'>
        <span className='mdi mdi-currency-ngn'></span>{price}
        <span>/month</span>
      </h3>
    </div>
  )
}

export default PricingBox;
